    false,nt"url": null,nt"notes": "This annual narrative report for Arctic
    NWR outlines Refuge accomplishments during the 1983 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan,
    public participation, compliance with environmental and cultural resource mandates,
    and research and investigations. Refuge administration is outlined; information
    about personnel, youth programs, manpower programs, volunteer programs, funding,
    and safety is given. Habitat management is also covered; subjects include wetlands,
    forests, grazing, and fire management. The wildlife section of the report discusses
    endangered and threatened species, raptors, game mammals, marine mammals, fisheries
    resources, and marking and bird banding. The public uses of the Refuge described
    in this report include hunting, fishing, trapping, wildlife observation, and law
    enforcement. The equipment and facilities section of the report provides information
    about equipment replacement and communication systems. Cooperative programs and
    items of interest are provided at the end.",nt"license_title": "License Not
